# Returns an interpolant for the given isochrone. Can be customised with
def get_isochrone_rad_lum(**kwargs):
	from scipy.interpolate import interp1d
	from math import sqrt, pi

	# You can customise the base isochrone by modifying the iso_teff and iso_lbol keyword arguments. 
	iso_teff = dotter_iso_teff if 'iso_teff' not in kwargs else kwargs['iso_teff']
	iso_lbol = dotter_iso_lbol if 'iso_lbol' not in kwargs else kwargs['iso_lbol']
	iso_rad = None if 'iso_rad' not in kwargs else kwargs['iso_rad']
	extrapolate = kwargs['extrapolate'] if 'extrapolate' in kwargs else False

	iso_x = [ 10.0 ** lbol for lbol in iso_lbol ]
	if iso_rad:
		iso_y = iso_rad
	else:
		# If we don't have the radius, we should calculate it from the Lbol and Teff. 
		iso_y_cm = [ sqrt(( 10.0 ** ( lbol ) * l_sun ) / ( 4.0 * pi * stefan_boltzmann * ( teff ** 4.0 ) )) for lbol, teff in zip(iso_lbol, iso_teff) ]
		iso_y = [ y / r_sol for y in iso_y_cm ]
	iso_func = interp1d(iso_x, iso_y, kind='linear', fill_value='extrapolate' if extrapolate else None)
	return iso_func

# Call this to find out if your effective temeprature is valid to use the relation for. 
def rad_tsed_is_valid(teff):
	return teff <= rad_teff_valid_ubound and teff >= rad_teff_valid_lbound

# This returns a tuple containing functions for the temperature - radius relation and the associated bounds. 
def get_rad_tsed_relation(coeff_file = os.path.join(os.path.dirname(__file__), "tsed-r-coeffs.json"), **kwargs):
	import json
	import numpy as np

	if not os.path.exists(coeff_file):
		print("Error: Unable to find relation coefficients file: {}".format(coeff_file))
	else:
		# Get the coefficients from the JSON file
		with open(coeff_file, 'r') as fh:
			rel = json.load(fh)
		
		# Now construct the functional form of the relation from the coefficients in the file. 
		rel_func = np.poly1d(rel['med'])
		lbound_func = np.poly1d(rel['lbound'])
		ubound_func = np.poly1d(rel['ubound'])

		return (rel_func, lbound_func, ubound_func)

# Call this to find out if your effective temeprature is valid to use the relation for. 
def rad_lsed_is_valid(lum):
	return lum <= rad_lum_valid_ubound and lum >= rad_lum_valid_lbound

# Returns just the function for the correction on top of the Baraffe 2015 4 Gyr isochrone. 
def get_rad_lsed_correction(coeff_file = os.path.join(os.path.dirname(__file__), "dotter08-lsed-r-coeffs.json"), **kwargs):
	import json
	import numpy as np

	if not os.path.exists(coeff_file):
		print("Error: Unable to find relation coefficients file: {}".format(coeff_file))
	else:
		# Get the coefficients from the JSON file
		with open(coeff_file, 'r') as fh:
			rel = json.load(fh)
		
		# Now construct the functional form of the correction from the coefficients in the file. 
		rel_func = np.poly1d(rel['med'])
		lbound_func = np.poly1d(rel['lbound'])
		ubound_func = np.poly1d(rel['ubound'])

		return (rel_func, lbound_func, ubound_func)

# This returns a tuple containing functions for the luminosity - radius relation and the associated bounds. 
def get_rad_lsed_relation(coeff_file = os.path.join(os.path.dirname(__file__), "dotter08-lsed-r-coeffs.json"), **kwargs):
	import numpy as np

	# First we pull in the correction using the helper function. 
	rel, lb, ub = get_rad_lsed_correction(coeff_file)

	# Now we apply the correction to the isochrone using an interpolation. 
	iso_func = get_isochrone_rad_lum() if 'iso_func' not in kwargs else kwargs['iso_func']

	# Now we define the functions for the relation and bounds. 
	def rel_func(lum):
		return rel(lum) + iso_func(lum)

	def lbound_func(lum):
		return lb(lum) + iso_func(lum)
	
	def ubound_func(lum):
		return ub(lum) + iso_func(lum)

	return (rel_func, lbound_func, ubound_func)